import styled from "styled-components";

export const Container = styled.div`
  float: left;
  margin: 0;
  height: auto;
  width: 100%;
`;

export const Header = styled.div`
  width: 100%;
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

export const ListItems = styled.div`
  display: block;
  float: left;
  padding: 5px 0;
  width: 100%;
`;
